❗️🇷🇺#индексы #россия
Новые базы расчета индексов Московской 

Московская биржа сформировала базы расчета индексов акций, которые будут действовать с 20 марта 2020 года, а также установила значения коэффициентов free-float для ценных бумаг ряда эмитентов.

Из базы расчета Индекса МосБиржи и Индекса РТС исключаются депозитарные расписки Ленты Лтд #{$LNTA} В лист ожидания на включение в основные индексы войдут обыкновенные акции "Эн+ Груп" #{$ENPL} и депозитарные расписки QIWI PLC. #{$QIWI}

В базу расчета Индекса голубых фишек войдут обыкновенные акции ПАО "Полюс" #{$PLZL}, покинут индекс обыкновенные акции ПАО "Северсталь". #{$CHMF}

База расчета Индекса акций широкого рынка изменится за счет исключения из состава привилегированных акций ПАО "Селигдар" #{$SELG}  и включения депозитарных расписок ЭТАЛОН ГРУП ПИЭЛСИ. #$ETLN Депозитарные расписки МКПАО "Эн+ Груп" #ENPL будут заменены обыкновенными акциями данного эмитента.

Базу расчета Индекса средней и малой капитализации дополнят обыкновенные акции ПАО "Акрон" #AKRN и ПАО "Аптечная сеть 36,6". #{$APTK}

Обыкновенные акции ПАО НК "РуссНефть" #$RMFT и ПАО "ТМК" #{$TRMK} покинут Индекс нефти и газа.

В базу расчета Индекса МосБиржи 10 войдут обыкновенные акции ПАО "Магнит" #{$MGNT} и ПАО "РусГидро" #{$HYDR}, им уступят место привилегированные акции ПАО "Сургутнефтегаз" #{$SNGS} и акции иностранного эмитента Яндекс Н.В. #{$YNDX}

В базу расчета Индекса МосБиржи инноваций включаются обыкновенные акции ПАО "ОАК". #UNAC

Обновлены корзины индексов активов пенсионных накоплений и параметры баз расчета индексов МосБиржи - РСПП.

{$ENPG}

